(window.webpackJsonp=window.webpackJsonp||[]).push([[92],{313:function(e){e.exports={data:{posts:{totalCount:83,pageInfo:{totalPages:9,currentPage:4,isFirst:!1,isLast:!1},edges:[{node:{title:"Living in the City (you know you have to survive)",image:"/media/images/blog/map.png",path:"/blog/2017/08/14/living-in-the-city-you-know-you-have-to-survive",excerpt:"<p>Well, my life has changed.</p>\n",date:"2017-08-14T00:00:00.000Z",timeToRead:2}},{node:{title:"New Zealand Politics 2017",image:"/media/images/blog/IMG_20170801_115130_007.jpg",path:"/blog/2017/08/02/new-zealand-politics-2017",excerpt:"<p>New Zealand doesn’t have a political system like the United States. The head of the country isn’t someone you vote for directly. Instead you vote for a political party, and the head of a particular party then becomes the countries leader – or Prime Minister.</p>\n",date:"2017-08-02T00:00:00.000Z",timeToRead:5}},{node:{title:"The Nuclear Option",image:"/media/images/blog/nuclear-fission3.jpg",path:"/blog/2017/07/27/the-nuclear-option",excerpt:"<p>Nuclear power has always been very controversial, but since the disaster in Japan at the Fukushima Daiichi power plant the topic has come under more scrutiny than ever.</p>\n",date:"2017-07-27T00:00:00.000Z",timeToRead:5}},{node:{title:"When Nice Stuff Happens",image:"/media/images/blog/IMG_20170715_124011.jpg",path:"/blog/2017/07/15/when-nice-stuff-happens",excerpt:"<p>Doesn’t stuff happen? Nice stuff happens. I like it when nice stuff happens.</p>\n",date:"2017-07-15T00:00:00.000Z",timeToRead:2}},{node:{title:"Query the theoretical",image:"/media/images/blog/boom.jpg",path:"/blog/2017/07/11/query-the-theoretical",excerpt:"<p>This will be a bit of thinking out loud, a stream of consciousness. It won’t have the editorial quality that I’m trying to follow, but some strange force is motivating me to put this out before I sleep. It’s just turned 1 am.</p>\n",date:"2017-07-11T00:00:00.000Z",timeToRead:3}},{node:{title:"Oh What a Night?",image:null,path:"/blog/2017/06/30/oh-what-a-night",excerpt:"<p>This is the finish my friend, this is the End.</p>\n",date:"2017-06-30T00:00:00.000Z",timeToRead:1}},{node:{title:"It's Business Time",image:"/media/images/blog/IMG_20170624_153338.jpg",path:"/blog/2017/06/25/it-s-business-time",excerpt:"<p>In my great effort to move forward and get down to business, I got business cards printed.</p>\n",date:"2017-06-25T00:00:00.000Z",timeToRead:1}},{node:{title:"Research report into Name of Austin",image:"/media/images/blog/eggs.png",path:"/blog/2017/06/21/research-report-into-name-of-austin",excerpt:'<h3 id="what-is-austin"><a href="#what-is-austin" aria-hidden="true"><span class="icon icon-link"></span></a>What is Austin?</h3>\n',date:"2017-06-21T00:00:00.000Z",timeToRead:3}},{node:{title:"I have, I want",image:null,path:"/blog/2017/06/16/i-have-i-want",excerpt:"<p>First, I built a splash page profile to help expand my reach as I go into this new world of freelance, casual employment.</p>\n",date:"2017-06-16T00:00:00.000Z",timeToRead:2}},{node:{title:"Public Spoken",image:null,path:"/blog/2017/06/15/public-spoken",excerpt:'<p>I did a presentation with the <a href="https://humanist.nz/" target="_blank" rel="nofollow noopener noreferrer">Humanist Society of New Zealand</a>. About 20 people attended, all in a meeting room above a pub in the middle of the city. I’d say it went well, although I’m sure from an outside perspective I was awkwardly squeezing words out of my mouth.</p>\n',date:"2017-06-15T00:00:00.000Z",timeToRead:2}}]}}}}}]);